import React, { useState } from 'react';
import axios from 'axios';
import './Excel.css';

function App() {
  const [file, setFile] = useState(null);
  const [data, setData] = useState(null);
  const [dragActive, setDragActive] = useState(false);

  const handleFileChange = (e) => {
    const selectedFile = e.target.files?.[0];
    if (selectedFile && selectedFile.name.endsWith('.csv')) {
      setFile(selectedFile);
    } else {
      alert('Please upload a valid CSV file');
    }
  };

  const handleDrop = (e) => {
    e.preventDefault();
    setDragActive(false);
    const droppedFile = e.dataTransfer.files[0];
    if (droppedFile && droppedFile.name.endsWith('.csv')) {
      setFile(droppedFile);
    } else {
      alert('Only .csv files are supported');
    }
  };

  const handleDragOver = (e) => {
    e.preventDefault();
    setDragActive(true);
  };

  const handleDragLeave = () => {
    setDragActive(false);
  };

  const handleUpload = async () => {
    if (!file) {
      alert('Please upload a file first');
      return;
    }

    const formData = new FormData();
    formData.append('file', file); // Match backend field name

    try {
      const res = await axios.post('http://localhost:5000/upload', formData);
      setData(res.data.count);
    } catch (err) {
      console.error("Upload failed", err);
    }
  };

  return (
    <div className="App">
      <nav className="navbar">
        <div className="navbar-logo">Meesho</div>
        <div className="navbar-links">
          <a href="/">Home</a>
          <a href="/">Upload</a>
          <a href="/">Dashboard</a>
        </div>
      </nav>

      <h1 className='heading'>Product Status Dashboard</h1>

      <div className="status-boxes">
        <div className="box delivered">Delivered<br /><span>{data?.deliver || 0}</span></div>
        <div className="box buy">DOOR_STEP_EXCHANGED<br /><span>{data?.buy || 0}</span></div>
        <div className="box rto">Pending<br /><span>{data?.pending || 0}</span></div>
        <div className="box return">Return<br /><span>{data?.return || 0}</span></div>
        <div className="box cancel">Cancel<br /><span>{data?.cancel || 0}</span></div>
      </div>

      <div 
        className={`upload-section ${dragActive ? 'drag-active' : ''}`}
        onDrop={handleDrop}
        onDragOver={handleDragOver}
        onDragLeave={handleDragLeave}
      >
        <p>Drag and drop your CSV file here or</p>
        <input
          type="file"
          accept=".csv"
          onChange={handleFileChange}
        />

        {file && <p className="filename">Selected File: {file.name}</p>}
        <button onClick={handleUpload}>Upload CSV File</button>
      </div>
    </div>
  );
}

export default App;
